  [],\n\t\"title\": \"The StreamCat Dataset: Accumulated Attributes for NHDPlusV2
  Streams and Catchments (Version 2.1) for the Conterminous United States: 2006 National
  Land Cover Database Riparian Zones\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  3,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-09-24T15:28:36.652073\",\n\t\"name\": \"the-streamcat-dataset-accumulated-attributes-for-nhdplusv2-streams-and-catchments-version-2-1-fd7ea0\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents data derived from
  the NLCD dataset and the National Hydrography Dataset version 2.1(NHDPlusV2) (see
  Data Sources for links to NHDPlusV2 data and NLCD). Attributes were calculated for
  every local NHDPlusV2 catchment and accumulated to provide watershed-level metrics
  for classes within the NLCD and within a 100-m buffer of the NHDPlusV2 stream lines.
  This data set is derived from the NLCD raster composed of 16 land cover classes
  (categorical data type) for the conterminous USA. Four classes of the NLCD were
  excluded as they were specific to Alaska land covers. This raster was produced based
  on a decision-tree classification of circa 2006 Landsat satellite data.(see Data
  Structure and Attribute Information for a description of each metric). The NHDPlusV2
  stream lines were buffered to create a mask that was used to constrain calculations
  of NLCD metrics to within 100-m of NHDPlus stream lines.\",\n\t\"license_title\":
